export default function Header() {
    return (
        <nav className="navbar">
            <figure>
                <img src="https://fontmeme.com/permalink/200411/65857c64854c31a8d0ca5720121909ae.png" />
            </figure>
        </nav>
    );
    <style jsx>{`
         .navbar{
            background: #000;
            display: block;
            padding: 12px 0;
            z-index: 500;
        }

        .navbar img{
            width: 120px;
            align-items: center;
            margin: 0;
            padding: 0;
        }
    `}</style>
};
